import React from 'react';

const testimonials = [
  {
    id: 1,
    name: 'Beenish Mumtaz',
    feedback: 'I absolutely love the quality and style of the clothing. The fit is perfect!',
    rating: 5,
  },
  {
    id: 2,
    name: 'Maria Shabbir',
    feedback: 'The customer experience was exceptional from start to finish. Highly recommend!',
    rating: 4.5,
  },
  {
    id: 3,
    name: 'Ayra Khan',
    feedback: 'The clothes I bought are fashionable and comfortable. Will shop again!',
    rating: 4.8,
  },
];

const Feedback = () => {
  return (
    <div className="container my-5">
      <h2 className="fw-bold text-center mb-4">Customer Feedback</h2>
      <p className="text-center mb-5">
        Hear what our satisfied customers have to say about us.
      </p>

      <div className="row">
        {testimonials.map((testimonial) => (
          <div key={testimonial.id} className="col-lg-4 col-md-6 mb-4">
            <div className="card shadow-sm border-light rounded text-center">
              <div className="card-body">
                <p className="card-text">"{testimonial.feedback}"</p>
                <h5 className="card-title">{testimonial.name}</h5>
                <p className="card-rating">Rating: {testimonial.rating} ‚≠ê</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Feedback;
